releases/0/tender/description:
The Service Provider will be required to provide a routine maintenance, breakdown repair, calibration and support to approximately 12000 portable radiation protection instruments (PRPI).

These PRPI are employed in various plants (controlled and uncontrolled areas) and locations on the Sellafield site. The following services are typically required:

Calibration and repair of:
• Portable radiation monitors (β, γ, x-ray, n);
• Portable contamination monitors (α, β, photon);
• α and β scaler and drawer systems;
• Check sources for these instruments; and
• Control dosemeters;

Calibration and adjustment of:
• Criticality Circuit Boards; and
• Installed Gamma Monitors;

Calibration \\ exposure of:
• Lithium Fluoride Chips;
• Management of A PRPI collection and delivery service; and
• A source receipt, onward delivery and re-calibration service

The Service Provider will be required to supply suitably qualified and experienced personnel (SQEP) for Sellafield Ltd to allocate to maintenance and asset care activities on installed radiation protection instrumentation (IRPI) to match site priorities. The equipment being maintained is located in over 100 facilities that are spread across the entire Sellafield site and owned by multiple independent operating units. A limited on-call service (invoked by the site shift manager) must be in place for repair of essential IRPI outside of normal working hours.

The Service Provider will ensure that all the instruments continue to be fit for purpose, appropriately calibrated and operational on demand, and it is expected that the Service Provider will use external best practice to identify latest developments and innovation with regard to this technology for consideration by Sellafield.

Other services that underpin maintenance, that the contractor will be expected to provide, include technical support, asset care, management of spares, documentation and safe use of radioactive sources associated with this scope of supply.

The typical range of equipment that the procured resource will be deployed on is listed below:
• Contamination Monitors;
• Criticality & Evacuation (CID / CIDAS / BES);
• Filter Canister Testers in Laundry;
• Gamma Monitors (Area);
• Gamma Monitors (Interlock);
• Gamma Monitors (Process);
• Hand & Foot Monitors;
• Hand Monitors;
• Installed Personnel Monitors;
• iSolos;
• Particulate in Air Monitors;
• Pressure Systems; and
• SEMPS system.

We are looking to build a new website, a legacy site, which: 
Showcases MIDEQ's extensive academic, policy and creative outputs as well as the project's impact; 
Provides a fully searchable library of outputs for engaged audiences/users; 
Includes an accessible (but protected) back-end that can be used to support the work of the MIDEQ Network
